function changeGoLive(){PNotify.prototype.options.styling="fontawesome";var n=$("#cbIsLive").is(":checked");$.ajax({url:"/api/v1/system/setting",method:"post",contentType:"application/json",dataType:"json",success:function(){n?new PNotify({title:"System is: LIVE",text:"The system is now online and any available SMS messages will be sent.",type:"success",icon:!0,animation:"fade",shadow:!0,desktop:{desktop:!1}}):new PNotify({title:"System is: NOT LIVE",text:"The system is not live and any available SMS message will not be sent.",type:"warn",icon:!0,animation:"fade",shadow:!0,desktop:{desktop:!1}})},error:function(n){new PNotify({title:"changeGoLive() Error",text:JSON.stringify(n),type:"error",icon:!0,width:1e3})},data:JSON.stringify({Setting:"IsLive",Value:$("#cbIsLive").is(":checked")})})}